import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4 4a2 2 0 00-2 2v8c0 1.1.9 2 2 2h12a2 2 0 002-2V6a2 2 0 00-2-2H4zM3 6a1 1 0 011-1h12a1 1 0 011 1v5H3V6zm0 6h14v2a1 1 0 01-1 1H4a1 1 0 01-1-1v-2z", fill: primaryFill }));
};
const PanelBottom20Regular = wrapIcon(rawSvg({}), 'PanelBottom20Regular');
export default PanelBottom20Regular;
